window.bookSummaryJSON = "<p><b>I was dead. At least, I thought I was.</b></p> <p>I should have been… but when I wake up in an odd realm with only Anani and Azrael to tether me to reality, I realize that this may not be the end. I have a larger purpose. One that includes saving everyone from the dragon god that was responsible for my death.</p> <p>All I have to do is find the strength to be reborn.</p> <p>Ruling In Flames <i>is the final installment of the Reborn series and will end with a HEA for our main character and her men. This is a slow/medium burn fantasy reverse harem that features a naive but strong MFC with a troubled past and a secret about what she really is. Come meet Maya and her protective and possessive dragon shifters!</i></p> <p><i>For mature listeners.</i></p>"; 
